package cn.com.phinfo.protocol;import java.util.List;import java.util.Stack;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class NewsChannelRun extends QuickRunObjectBase {	public NewsChannelRun() {		super(LURLInterface.GET_URL_NEWS_channel(),null,NewsChannelResultBean.class);	}	public static class NewsChannelResultBean extends HttpResultBeanBase{		private List<HSelectItem> listData = new Stack<HSelectItem>();		public List<HSelectItem> getListData() {			return listData;		}		public void setListData(List<HSelectItem> listData) {			this.listData = listData;		}	}	public static class HSelectItem{		private boolean bSel=false;		private String itemid;		private String name;		public boolean isbSel() {			return bSel;		}		public HSelectItem setbSel(boolean bSel) {			this.bSel = bSel;			return this;		}		public String getName() {			return name;		}		public void setName(String name) {			this.name = name;		}		public String getItemid() {			return itemid;		}		public void setItemid(String itemid) {			this.itemid = itemid;		}		public static HSelectItem initDefault(){			return HSelectItem.init(-1);		}		public static HSelectItem initHot(){			return HSelectItem.init(-2);		}				private static HSelectItem init(int id){			HSelectItem it = new HSelectItem();			it.itemid=String.valueOf(id);			switch(id){			case -1:it.name="推荐";break;			case -2:it.name="热点";break;			}			return it;		}		}}